import { BrowserRouter as Router, Route, Routes } from "react-router-dom"
import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

import Home from "./Pages/Home/Home";
import Compra from "./Pages/Compra/Compra";
import Sac from "./Pages/Sac/Sac";
import Destino from "./Pages/Destino/Destino";
import Formulario from "./Pages/Formulario/Formulario";
import Excluir from "./Pages/Excluir/Excluir";


ReactDOM.render(
  <React.StrictMode>
    <Router>
      <Routes>
        <Route path="/" exact element= {<Home></Home>}></Route>
        <Route path="/Sac" element= {<Sac></Sac>}></Route>
        <Route path="/Destino" element= {<Destino></Destino>}></Route>
        <Route path="/Compra" element= {<Compra></Compra>}></Route>
        <Route path="/Formulario" element= {<Formulario></Formulario>}></Route>
        <Route path="/Excluir" element= {<Excluir></Excluir>}></Route>
        <Route path="/Consulta" element= {<Consulta></Consulta>}></Route>Compra>}>
      </Routes>
  </Router>
  </React.StrictMode>,
  document.getElementById("root")
);
